import React from "react";

const Home = () => {
    return (
        <>
        <div className="container-fluid">
            <div className="row">
                <img className="logo1-image" src={process.env.PUBLIC_URL + "/Images/image.jpg"} alt="Random_Image" />
            </div>
        </div>
        </>
    )
};

export default Home;
